define('loaders/TemplateLoader',[],function(){
	return {
		templateRoot: '../templates/',
		batchLoad:function(views, callback){

	        var deferreds = [];

	        $.each(views, function(index, view) {
	            if (window[view]) {
	                deferreds.push($.get('../templates/' + view + '.html', function(data) {
	                    window[view].prototype.template = _.template(data);
	                }, 'html'));
	            } else {
	                alert(view + " not found");
	            }
	        });

	        $.when.apply(null, deferreds).done(callback);
	    },
	    load:function(view, callback)
	    {
	    	$.get(this.templateRoot + view + '.html', 
	    		function(data) {
	                 callback(_.template(data));
	            }, 'html');
	    }
	}
});
"use strict";
define('loaders/AppLoader',[],function(){
	return {			    
	    load:function(apps, callback){
	    	var loadedApps=[];	    	
	    	apps.forEach(function(appName){
		    	var appRequire = requirejs.config({
		    		baseUrl:'/'+appName,
		    		context:appName,
		    		waitSeconds:0,
		    		config:{
						i18n:{
							locale: 'zh-cn' //force to use this locale for test translation
						}
					},
		    		paths:{
		    			'i18n'	: openbiz.baseUrl+'/vendor/require/plugins/i18n',
						'text'	: openbiz.baseUrl+'/vendor/require/plugins/text'
		    		}
		    	});	    	
		    	appRequire(['./main'],function(app){
				    var app = new app();
			    	app.require = appRequire;
			    	app.views = new app.views();
			    	app.views._app = app;
			    	openbiz.apps[app.name] = app;
			    	openbiz.loadedApps.unshift(app.name);
		    		loadedApps.push(app);
		    		if(loadedApps.length == apps.length){
		    			callback(loadedApps);
		    		}
		    	});	
	    	});
	    }
	}
});
