"use strict";
define('views/elements/forms/DropdownView',['./OptionElement',
		'text!./DropdownView.html'],
	function(element,templateData){
	return element.extend({
		_selector:null,
		_parent:null,
		init:function(metadata,parent,model,reload){
			openbiz.OptionElement.prototype.init.call(this,metadata,parent);
			var selector = "div.field-"+metadata.name.toLowerCase();
			this._selector = selector;
			this._parent = parent;
			if (parent.$el.find(selector).length == 0) return; //ignore it, if it doesn't mount on UI
			if (parent.$el.find(selector).children().length>0 && reload != true) return; //ignore it, if has custom template

			if(typeof metadata.permission!='undefined'){
				if(typeof openbiz.session.me=='undefined' || !openbiz.session.me.hasPermission(metadata.permission)){							
					return ;
				}
			}
			var template = _.template(templateData);
			var labelLocaleKey = 'field'+metadata.name.charAt(0).toUpperCase()+metadata.name.slice(1);
			var placeholderLocaleKey = 'placeholder'+metadata.name.charAt(0).toUpperCase()+metadata.name.slice(1);
			metadata.displayName = parent.locale[labelLocaleKey]?parent.locale[labelLocaleKey]:metadata.displayName;		
			metadata.className = metadata.className?metadata.className.replace(/\./g," "):'';
			metadata.icon = metadata.icon?metadata.icon.replace(/\./g," "):"";			
			metadata.placeholder = parent.locale[placeholderLocaleKey]?parent.locale[placeholderLocaleKey]:metadata.placeholder;		
			metadata.elemName = "record-"+metadata.name.toLowerCase();
			metadata.multiple = metadata.multiple?metadata.multiple:false;
			if(!metadata.displayValue) metadata.displayValue = metadata.field;
			if(metadata.displayValue.indexOf("{{")!=-1){
				metadata.displayValue =  _.template(metadata.displayValue,
													{record:model},
													{
														evaluate    : /\{%([\s\S]+?)%\}/g,
														interpolate : /\{\{([\s\S]+?)\}\}/g,
														escape      : /\{-([\s\S]+?)\}/g
													});
			}else{
				if(metadata.displayValue.indexOf('.')==-1){
					metadata.displayValue = model[metadata.displayValue]?model[metadata.displayValue]:model.get(metadata.displayValue);
				}else{
					  var attrArray = metadata.displayValue.split('.');
				      var data = model.get(attrArray[0]);
				      var value = data;
					  for(var i =1; i<attrArray.length; i++){
				        var indexName = attrArray[i];
				        value = value[indexName];
				      }  
				      metadata.displayValue = value;
				}
			}	

			var renderElement = function(){				
				parent.$el.find(selector).replaceWith($(template(metadata)).addClass("field-"+metadata.name.toLowerCase()));
				if(metadata.required==true) parent.$el.find(selector).find("select").attr('parsley-required','true');
				if(metadata.multiple==true) {
					parent.$el.find(selector).find("select").attr('multiple','multiple');
					parent.$el.find(selector).find("select").attr('title',metadata.placeholder);					
				}				
				parent.$el.find(selector).find("select").val(metadata.displayValue)
				parent.$el.find(selector).find("select").selectpicker();

			}
			metadata.selections = [];
			var self = this;

			this._parseModel(function(){
				if(self._modelType != "model"){
					//internal
					for(var i = 0; i < self.collection.length; i++){
						metadata.selections.push({
							value:self.collection[i],
							display:self.collection[i]
						});				
					}
					renderElement();
				}else{
					//model
					self.collection.fetch({
						success:function(){	
							for(var i = 0; i < self.collection.models.length; i++){
								var model = self.collection.models[i];
								metadata.selections.push({
									value: self._parseField(model,self._dataSource.valueField),
									display: self._parseField(model,self._dataSource.displayField)
								});									
							}
							renderElement();
						}
					})
				}
			})

			return this;
		},
		reload:function(metadata,parent,model){
			this.init(metadata,parent,model,true);
			return this;
		},
		getValue:function(){			
			return this._parent.$el.find(this._selector + ' select').val();
		}
	});
});


"use strict";
define('views/elements/forms/RadioView',['./OptionElement'],function(element){
	return element.extend({
		_selector:null,
		init:function(metadata,parent,model){
			var defautValue = model.get(metadata.field);
			openbiz.OptionElement.prototype.init.call(this,metadata,parent);
			var self = this;
			this._parseModel(function(){
				self._selector = "field-"+self.metadata.name.toLowerCase();
				var data = "<div class='form-group'><label class='control-label'>"+ parent.locale[self.metadata.fieldName] +"</label>";
				var div = "<ul data-color='red' class='iCheck'>";
				if(self._modelType == "internal"){
					for(var i = 0; i < self.collection.length; i++){
						var display = self.collection[i];
						div += "<li class='pull-left' style='margin-right: 10px'><input type='radio' name='"+self.metadata.name+"' data-display-field='"+display+"' data-value-field='"+display+"'/><label>"+display+"</label></li>";
					}
					div += "</ul></div>";
					$(self.parent.el).find("."+self._selector).append(data+div);
					self._setDefaultValue(defautValue);
					self._update();
				}else if(self._modelType == "model"){
					self.collection.fetch({
						success:function(){
							for(var i = 0; i < self.collection.models.length; i++){
								var model = self.collection.models[i];
								var display =  self._parseField(model,self._dataSource.displayField);
								var value = self._parseField(model,self._dataSource.valueField);
								div += "<li class='pull-left' style='margin-right: 10px'><input type='radio' name='"+self.metadata.name+"' data-display-field='"+value+"'  data-value-field='"+value+"'/><label>"+display+"</label></li>";
							}
							div += "</ul></div>";
							self.parent.$el.find("."+self._selector).append(data+div);
							
							self._setDefaultValue(defautValue);
							self._update();
						}
					});
				}
			});
			return this;
		},
		_setDefaultValue:function(value){
			if(value == null || typeof value != "undefined")
			{
				if(this._modelType == "internal"){
					value = this.collection[0];
				}else{
					var model = this.collection.models[0];
					value = this._parseField(model,self._dataSource.valueField);
				}
			}
			var sel = "input:radio[name='"+this.metadata.name+"'][data-value-field='"+value+"']";
			$("."+this._selector).find(sel).attr('checked', 'true');
		},
		getValue:function(){
			var sel = "input:radio[name='"+this.metadata.name+"']:checked";
			return $("."+this._selector).find(sel).attr('data-value-field');
		},
		_update:function(){
			var createiCheck = (function() {
				$('.iCheck').each(function(i) {
					var  data=$(this).data() ,
						input=$(this).find("input") ,
						li=$(this).find("li") ,
						index="cp"+i ,
						insert_text,
						iCheckColor = [ "black", "red","green","blue","aero","grey","orange","yellow","pink","purple"],
						callCheck=data.style || "flat";
					if(data.color && data.style !=="polaris" && data.style !=="futurico" ){
						var hasColor= jQuery.inArray(data.color, iCheckColor);
						if(hasColor !=-1 && hasColor < iCheckColor.length){
							callCheck=callCheck+"-"+data.color;
						}
					}
					input.each(function(i) {
						var self = $(this), label=$(this).next(), label_text=label.html();
						self.attr("id","iCheck-"+index+"-"+i);
						if(data.style=="line"){
							insert_text='<div class="icheck_line-icon"></div><span>'+label_text+'</span>';
							label.remove();
							self.iCheck({ checkboxClass: 'icheckbox_'+callCheck, radioClass: 'iradio_'+callCheck, insert:insert_text  });
						}else{
							label.attr("for","iCheck-"+index+"-"+i);
						}
					});
					if(data.style!=="line"){
						input.iCheck({ checkboxClass: 'icheckbox_'+callCheck, radioClass: 'iradio_'+callCheck });
					}else{
						li.addClass("line");
					}
				});
			});
			createiCheck();
		}
	});
});


